// SPDX-License-Identifier: MIT

pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
// import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract DazedDucks is ERC721, Ownable {
    using SafeMath for uint256;

    uint256 public MAX_NFT_SUPPLY;
    uint256 public MINT_TIMESTAMP;
    bool public saleHasStarted = true;
    string public baseURI = 'ipfs://QmUvctUmemgZg1iPhCsfCoejp4ggeicxeSFPvwLuiNJR4e';
    uint256 public mintIndex = 1;
    uint256 public constant NFTPrice = 50000000000000000; // 0.05 ETH
    uint256 public startingIndexBlock;
    uint256 public startingIndex;

    constructor(string memory name, string memory symbol, uint256 maxNFTSupply, uint256 mintTimeStamp) ERC721(name, symbol)
    {
        MAX_NFT_SUPPLY = maxNFTSupply;
        MINT_TIMESTAMP = mintTimeStamp;
    }

    event Minted (
        uint256 id,
        string message 
    );

    function mintToken() public payable {
        require(saleHasStarted, "Sales has not started yet");
        require(NFTPrice <= msg.value, "Ether value sent is not correct");
        require(mintIndex <= MAX_NFT_SUPPLY, "All NFT's are sold out");

        _safeMint(msg.sender, mintIndex);

        emit Minted(mintIndex, 'Minting finished');
        mintIndex++;
    }

    function _baseURI() internal override view returns (string memory) {
        return baseURI;
    }

    function setBaseURI(string memory newBaseURI) external onlyOwner {
        baseURI = newBaseURI;
    }

    /**
     * This method is used by OpenSea
     */
    function baseTokenURI() public view returns (string memory) {
        return baseURI;
    }

    function withdraw() public payable onlyOwner {
        require(owner() == msg.sender, "You need to be the owner to run this method");

        address payable owner = payable(owner());

        uint balance = address(this).balance;
        owner.transfer(balance);
    }

    function setRevealTimestamp(uint256 mintTimeStamp) public onlyOwner {
        MINT_TIMESTAMP = mintTimeStamp;
    }

    function toggleSaleState() public onlyOwner {
        saleHasStarted = !saleHasStarted;
    }

    function getMintIndex() public view returns (uint256) {
        return mintIndex;
    }

    function getMaxNFTSupply() public view returns (uint256) {
        return MAX_NFT_SUPPLY;
    }
}
